      Health authorized the redesignation of the receipt to the Committees state account,
      and the resulting transfer is reported during this filing period (Schedule B,
      Line 22). Memo #2: Note that on Schedule D, the outstanding debt for FLS Connect
      was reduced by $ 1,196.85 due to overbilling. Memo #3: Note that on Schedule
      D, the outstanding debt for Direct Mail Systems, Inc. was reduced by $ 4,239.92
      due to overbilling. Memo #4: Note that on Schedule A, Line 11a, Schedule B,
      Line 26 and Schedule D, contributions of $ 1,000 from Michael Scheel and of
      $ 1,000 from F. Douglas Day, as well disbursements representing loan repayments
      in the amount of $ 1,000 each toward both the Michael Scheel and the F. Douglas
      Day loans, amount total of $ 2,000, reflect in kind forgiveness against the
      loan balance owed. The balance reflected on Schedule D at the close of the period
      is accurate. The Committees software contains an error that affects the proper
      disclosure of payments against debt when those payments require memo entries
      on Schedule B or H4. The Committee is working with the software vendor to resolve
      this issue.'
